  summary: "\nSets the <xref href=\"OfficeOpenXml.Drawing.Vml.ExcelVmlDrawingGradientFill.ColorsString\" data-throw-if-not-resolved=\"false\"></xref> with the colors supplied and optionally \n<xref href=\"OfficeOpenXml.Drawing.Vml.ExcelVmlDrawingFill.Color\" data-throw-if-not-resolved=\"false\"></xref> and <xref href=\"OfficeOpenXml.Drawing.Vml.ExcelVmlDrawingFill.SecondColor\" data-throw-if-not-resolved=\"false\"></xref>.\nEach color item starts with a percent and a color. \nPercent values must be sorted, starting from 0% and ending and 100%.\nIf 0% is omitted, <xref href=\"OfficeOpenXml.Drawing.Vml.ExcelVmlDrawingFill.Color\" data-throw-if-not-resolved=\"false\"></xref> is used.\nIf 100% is omitted, <xref href=\"OfficeOpenXml.Drawing.Vml.ExcelVmlDrawingFill.SecondColor\" data-throw-if-not-resolved=\"false\"></xref> is used.\n"
